import React, { Component } from 'react'
import {Form,Button, FormLabel} from 'react-bootstrap';
import './App.css';

class Registration extends Component {
    render() {
        return (
<div class="login-form">
    <form>
        <h2 class="text-center">User Registration</h2>       
        <div class="form-group">
            <input type="text" class="form-control" placeholder="FirstName" required="required"/>
            <input type="password" class="form-control" placeholder="LastName" required="required"/>
        </div>
        <div class="form-group">
            <input type="text" class="form-control" placeholder="FirstName" required="required"/>
            <input type="password" class="form-control" placeholder="LastName" required="required"/>
        </div>
        <div class="form-group">
            <button type="submit" class="btn btn-primary btn-block">Register</button>
        </div>
    </form>
    <p class="text-center"><a href="/login">Click here to Login</a></p>
</div>
  )
    }


}

export default Registration
